import React, { Component } from 'react'
import TodoList from "./TodoList";
import './App.css';

export class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>See Our Todos!</h1>
        <TodoList/>
      </div>
    )
  }
}

export default App
